package com.pku.xiaoyoubang.entity;import java.io.Serializable;public class InviteEntity implements Serializable{	/**	 * 	 */	private static final long serialVersionUID = 1L;		private String inviterId;	private String name;	private String headUrl;	private String time;	private boolean hasAnswered;	private boolean isOtherInviteMe;	private String inviteInfo;		public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getHeadUrl() {		return headUrl;	}	public void setHeadUrl(String headUrl) {		this.headUrl = headUrl;	}	public String getTime() {		return time;	}	public void setTime(String time) {		this.time = time;	}	public boolean isHasAnswered() {		return hasAnswered;	}	public void setHasAnswered(boolean hasAnswered) {		this.hasAnswered = hasAnswered;	}	public String getInviteInfo() {		return inviteInfo;	}	public void setInviteInfo(String inviteInfo) {		this.inviteInfo = inviteInfo;	}	public static long getSerialversionuid() {		return serialVersionUID;	}	public String getInviterId() {		return inviterId;	}	public void setInviterId(String inviterId) {		this.inviterId = inviterId;	}	public boolean isOtherInviteMe() {		return isOtherInviteMe;	}	public void setOtherInviteMe(boolean isOtherInviteMe) {		this.isOtherInviteMe = isOtherInviteMe;	}}